import React from "react";
import axios from "axios";

export default class Home extends React.Component{
    constructor(){
        super();
        this.state={
            movies:[],
        }
    }

    componentDidMount () {
        axios
            .post(`https://hoblist.com/movieList`)
            .then((response) => {
                console.log(response)
                this.setState({
                    movies:response.data
                })
              })
              .catch((err) => {
                if (err.response)
                  console.log("Error")
                else console.log(err);
              });
    }

    render(){
        return(
            <div>
                <nav class="navbar navbar-expand-lg"  style={{background:"#e3f2fd"}}>
                    <a class="navbar-brand" href="#" >Geeksynergy Technologies</a>
                    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>

                    <div class="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul class="navbar-nav mr-auto">
                        </ul>
                    </div>
                    <form class="form-inline my-2 my-lg-0">
                            <a class="nav-link" href="#">Company Info <span class="sr-only">(current)</span></a>
                    </form>
                </nav>
              <div>
                 {/* {this.state.movies.map((item, i) => {
                     return(
                             <ul>
                                 <li>{item.category}</li>
                                 <li>{item.language}</li>
                                 <li>{item.genre}</li>
                                 <li>{item.sort}</li>
                             </ul>
                             )
                         })} */}
                
                         </div>
                  <div className="footer" style={{position:"fixed", textAlign:"center", width:100}}>
                         <h1>Hello Footer</h1>
                  </div>
            </div>

        )
    }
}
